import { FC } from "react";
import { OrderResponse } from "../types/order-response-type";

type TradeListProps = {
    marketPrice: number
  tradeList: OrderResponse[];
};

export const TradeList: FC<TradeListProps> = ({ tradeList, marketPrice }) => {
  return (
    <div className="bg-white rounded-md max-h-60 w-3/4">
      <div className="flex justify-between p-2 font-bold">
        <p>Trade</p>
        <p>Order Type</p>
        <p>Asset</p>
        <p>Amount</p>
        <p>Price</p>
        <p>Total</p>
      </div>
      <div className="overflow-y-scroll h-4/5 pb-2">
        {tradeList.map((trade, idx) => {
          return (
            <div key={idx} className="flex justify-between p-2 text-sm font-semibold">
                <p className={`${trade.side === 'BUY' ? 'text-green-500' : 'text-red-500'}`}>{trade.side}</p>
                <p>{trade.type}</p>
                <p>{trade.asset}</p>
                <p>{trade.quantity}</p>
                <p>${trade.type === 'LIMIT' ? trade.price : marketPrice}</p>
                <p>${trade.notional}</p>
            </div>
          );
        })}
      </div>
    </div>
  );
};
